message:
Aceleradores de partículas, HAARP, satélites e eletrônicos modernos são usados ​​para controle mental em massa. Programas geométricos são usados ​​com frequências eletromagnéticas irradiadas por redes sem fio, eletrônicos modernos e a rede eletrônica geral, incluindo medidores inteligentes e transformadores.  Grandes estações eletrônicas estão irradiando selos geométricos para a sociedade.  O HAARP é usado para controle mental em massa e está transmitindo programas projetados geometricamente na atmosfera que ressoam ao nosso redor.  Eles usam chemtrails para vários propósitos, incluindo aumentar suas frequências eletromagnéticas com partículas nanocondutoras que eles chamam de “poeira inteligente”.  As antenas de sprays militares e chemtrails funcionam de maneira semelhante.  Eles estão criando uma matriz artificial de controle da mente na atmosfera inferior.  A DARPA e a Força Aérea dos EUA se referiram ao “tempo próprio para uso militar”.

